import css from './Logo.module.css';
import logo from '../../images/logo.png';

const Logo = () => {
  return (
    <>
      <div className={css.headerLogo}>
        <img className={css.headerLogoImage} src={logo} alt="logo" />
        stellar<span className={css.headerTitle}>likes</span>
      </div>
    </>
  );
};

export default Logo;
